    'introtext' => '',
    'content' => '<p> Постановление Правительства РФ от 26 января 2017 г. N 88</p>
<div>
<p>В соответствии с частью 2 статьи 4.2 Федерального закона "О приостановлении действия положений отдельных законодательных актов Российской Федерации в части порядка индексации окладов денежного содержания государственных гражданских служащих, военнослужащих и приравненных к ним лиц, должностных окладов судей, выплат, пособий и компенсаций и признании утратившим силу Федерального закона "О приостановлении действия части 11 статьи 50 Федерального закона "О государственной гражданской службе Российской Федерации" в связи с Федеральным законом "О федеральном бюджете на 2015 год и на плановый период 2016 и 2017 годов" Правительство Российской Федерации постановляет:<br />1. Установить:<br />с 1 февраля 2017 г. размер индексации 1,054 для выплат, пособий и компенсаций, предусмотренных законодательными актами Российской Федерации, указанными в части 1 статьи 4.2 Федерального закона "О приостановлении действия положений отдельных законодательных актов Российской Федерации в части порядка индексации окладов денежного содержания государственных гражданских служащих, военнослужащих и приравненных к ним лиц, должностных окладов судей, выплат, пособий и компенсаций и признании утратившим силу Федерального закона "О приостановлении действия части 11 статьи 50 Федерального закона "О государственной гражданской службе Российской Федерации" в связи с Федеральным законом "О федеральном бюджете на 2015 год и на плановый период 2016 и 2017 годов";<br />с 1 сентября 2017 г. размер индексации 1,054 для выплат, указанных в части 1.1 статьи 4.2 Федерального закона "О приостановлении действия положений отдельных законодательных актов Российской Федерации в части порядка индексации окладов денежного содержания государственных гражданских служащих, военнослужащих и приравненных к ним лиц, должностных окладов судей, выплат, пособий и компенсаций и признании утратившим силу Федерального закона "О приостановлении действия части 11 статьи 50 Федерального закона "О государственной гражданской службе Российской Федерации" в связи с Федеральным законом "О федеральном бюджете на 2015 год и на плановый период 2016 и 2017 годов".<br />2. Настоящее постановление вступает в силу с 1 февраля 2017 г.</p>
</div>',
